function migratoryBirds(arr: number[]) { 
  const uniqueValues = new Set(arr.sort());

  let countValues = [];
  uniqueValues.forEach((uniqueVal) => {
    const totalCount = x.filter((birdType) => birdType === uniqueVal);
    console.log(totalCount.length)
    countValues.push(totalCount.length);
  });

  const maxValue = countValues.indexOf(Math.max(...countValues));

  return [...uniqueValues][maxValue];
}
